  const avgPerc = data.reduce((a, b) => a + b.deliveryPerc, 0) / data.length;
  const avgQty = data.reduce((a, b) => a + b.deliveryQty, 0) / data.length;
  const avgValue = data.reduce((a, b) => a + (b.close * b.deliveryQty), 0) / data.length;

